import React, { useEffect, useState } from 'react';

const BookNow = () => {
    const [Bookings, setBookings] = useState({
        name: "",
        email: "",
        destination: "",
        date: ""
    });

    // Fetch all bookings when component mounts
    useEffect(() => {
        getAllData();
    }, []);

    // Fetch all bookings
    const getAllData = async () => {
        await fetch('http://localhost:3001/bookings')
            .then((res) => res.json())
            .then((res) => {
                setBookings(res);
            })
            .catch(err => console.error("Error fetching bookings:", err));
    };

    // Add new booking
    const addBookings = async (e) => {
        e.preventDefault();
        await fetch("http://localhost:3001/bookings", {
            method: "POST",
            body: JSON.stringify(Bookings),
            headers: {
                "Content-Type": "application/json"
            }
        })
        .then((res) => res.json())
        .then(() => {
            alert("Booking added successfully!");
            getAllData();
        })
        .catch(err => console.error("Error adding booking:", err));
    };

    // Delete booking by name
    const deleteBookings = async () => {
        await fetch(`http://localhost:3001/bookings/${Bookings.name}`, {
            method: "DELETE"
        })
        .then(() => {
            alert("Booking deleted successfully!");
            getAllData();
        })
        .catch(err => console.error("Error deleting booking:", err));
    };

    // Update booking by name
    const updateBookings = async (e) => {
        e.preventDefault();
        await fetch(`http://localhost:3001/bookings/${Bookings.name}`, {
            method: "PUT",
            body: JSON.stringify(Bookings),
            headers: {
                "Content-Type": "application/json"
            }
        })
        .then((res) => res.json())
        .then(() => {
            alert("Booking updated successfully!");
            getAllData();
        })
        .catch(err => console.error("Error updating booking:", err));
    };

    const handleChange = (e) => {
        setBookings({
            ...Bookings,
            [e.target.name]: e.target.value
        });
    };

    return (
        <>
            <div className="bg-image" 
                style={{ 
                    backgroundImage: "url('https://img.freepik.com/premium-photo/soft-blur-nature-background-abstract-modern-website-graphics-with-smooth-gradient-background_532332-40.jpg')", 
                    backgroundRepeat: "no-repeat",
                    backgroundSize: "100% 100%",
                    height: "100vh"
                }}>
                <div className='bg-image'
                    style={{
                        backgroundImage: "url('https://media.istockphoto.com/id/1097481110/photo/passenger-plane-business-trip-travel-concept-flying-evening-sunset.jpg?s=612x612&w=0&k=20&c=f2itQWoW1ObaBI0wCQsaT2s7cpo5a_CIqEQItDW8g90=')", 
                        backgroundRepeat: "no-repeat",
                        backgroundSize: "100% 100%",
                        height: "40vh"
                    }}
                >
                    <h1 className='text-center me-1'><b>Arrived</b></h1>
                    <p className='text-center fs-4 me-1'><i>Unlock the best in Travel!</i></p>
                </div>
                <div className="container">
                    <h1 className="text-center"><b>Book Your Destination</b></h1>
                    <form className="mt-4" onSubmit={addBookings}>
                        <div className="mb-3">
                            <label className="form-label">Full Name</label>
                            <input
                                type="text"
                                className="form-control"
                                name="name"
                                placeholder='Please Enter Your Full Name'
                                value={Bookings.name}
                                onChange={handleChange}
                                required
                            />
                        </div>
                        <div className="mb-3">
                            <label className="form-label">Email</label>
                            <input
                                type="email"
                                className="form-control"
                                name="email"
                                placeholder='Please Enter Your E-mail'
                                value={Bookings.email}
                                onChange={handleChange}
                                required
                            />
                        </div>
                        <div className="mb-3">
                            <label className="form-label">Destination</label>
                            <input
                                type="text"
                                className="form-control"
                                name="destination"
                                placeholder='Please Enter Your Dream Place'
                                value={Bookings.destination}
                                onChange={handleChange}
                                required
                            />
                        </div>
                        <div className="mb-3">
                            <label className="form-label">Travel Date</label>
                            <input
                                type="date"
                                className="form-control"
                                name="date"
                                value={Bookings.date}
                                onChange={handleChange}
                                required
                            />
                        </div><br/>
                        <button type="submit" className="btn btn-outline-secondary text-light">Submit</button>
                    </form>
                </div>
            </div>
        </>
    );
}

export default BookNow;
